import styled from "@emotion/styled";
import { NONAME } from "dns";
import { useEffect, useState } from "react";
import { Line } from "react-chartjs-2";
// import styled from "@emotion/styled/macro";

export default function LeftMenu() {
  // styles
  const [chartData, setChartData] = useState({});

  const chart = () => {
    setChartData({
      labels: [
        "23 сен",
        "24 сен",
        "25 сен",
        "26 сен",
        "27 сен",
        "28 сен",
        "29 сен",
      ],
      datasets: [
        {
          label: "Income",
          data: [1000, 2700, 6000, 3250, 2100, 4900, 3000],
          borderColor: "rgba(46,113,243,1)",
          backgroundColor: "rgba(46,113,243,0.1)",
          borderWidth: 4,
        },
      ],
    });
  };
  const Container = styled.div`
    height: 200px;
    width: 565px;
    background: #fff;
    z-index: 0;
  `;
  const HidingBlock = styled.div`
    width: 565px;
    height: 200px;
    background: #fff;
    margin-top: -300px;
    z-index: 100;
  `;
  const MainBlock = styled.div`
    width: 600px;
  `;
  useEffect(() => {
    chart();
  }, []);
  return (
    <MainBlock>
      <Container>
        <Line
          data={chartData}
          options={{
            responsive: true,
            maintainAspectRatio: false,
            legend: { display: false },
            scales: {
              xAxes: [
                {
                  ticks: {
                    display: true,
                  },
                  gridLines: {
                    display: false,
                    drawBorder: false,
                  },
                },
              ],
              yAxes: [
                {
                  ticks: {
                    display: true,
                    callback: function (value, index, values) {
                      if (value > 5000) {
                        return "";
                      } else {
                        return value + "тыс. ₽";
                      }
                    },
                    max: 7000,
                  },
                  gridLines: {
                    display: true,
                    drawBorder: false,
                    z: -100,
                  },
                },
              ],
            },
          }}
        >
          {" "}
        </Line>
        <HidingBlock></HidingBlock>
      </Container>
    </MainBlock>
  );
}
